import React, { useState, useEffect }from "react";
import {Button, Container, Nav, Navbar,Row,Col} from 'react-bootstrap'
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function Home() {
    const navigate = useNavigate();
    const [data1, setData1] = useState([]);



      useEffect(() => {
        axios.get('http://localhost:8080/data2') 
          .then(res => {
            let copy = [...res.data]
            setData1(copy);
            console.log(res.data); 
          })
          .catch(err => {
            console.error(err);
          });
      }, []); 
      
   

    return (
        <div>
            <Navbar>

                <Container>
                    <Row>
                        <Col>
                            <Button variant="contained" color="primary" className="textst"
                                onClick={() => {
                                    navigate('/home')
                                }}>
                                Todolist
                            </Button>
                        </Col>
                        <Col xs="auto">
                            <Button variant="contained" color="primary" className="textst"
                                onClick={() => {
                                    navigate('/add')
                                }}>
                                Add
                            </Button>
                        </Col>
                    </Row>
                </Container>

                
                
                
                

            </Navbar>

            {/* {
                    data1.map((a,i) => {
                        console.log(a.title)
                        return (
                           <h5>
                            {a.title}
                           </h5>
                        )
                    })
            } */}

            <Container>
                <div className="small-square" >
                    <div className="top-left textst">date</div>
                    <div className="bottom-left textst">title</div>
                    <Button className="bottom-right" variant="light"> Detail </Button>"
                </div>
            </Container>

            
           
        </div>
    )
}

export default Home;
